import React from 'react'
import WeatherContext from '../../Utils/WeatherContext'
function Weather() {

    const context = useContext(WeatherContext)

    return (

        <div>
           <h1>{context.name}</h1>
    <p>{context.temperature}</p>
    <p>{context.humidity}</p>
    <p>{context.Windspeed}</p>
        </div>
    )
}

export default Weather;
